import React, {Component} from 'react';

class NoMatch extends Component {
  render() {
    return(
      <div>
        <h1>Page not found</h1>
        <p>We're sorry, but the page you're looking for can't be found</p>
      </div>
    );
  }
}

export default NoMatch;
